import style from "./Profileinfo.module.css"

const ProfileInfo = (props) =>{
return (
  <div>
    <div className={style.ava}>
      <img src={props.ava} alt=""/>
    </div>
    <div className="status">
      <p>{props.status}</p>
    </div>
  </div>
);
}

export default ProfileInfo;
